import { useEffect, useRef, useState } from "react";
import StarRating from "./StarRating";
import { useKey } from "./useKey";
import { useLocalStorageState } from "./useLocalStorageState";
import { useMovies } from "./useMovies";

const KEY = "c388b899";

export default function App() {
  const [query, setQuery] = useState("");
  const [selectedId, setSelectedId] = useState(null);
  const { movies, isLoading, error } = useMovies(query);
  const [watched, setWatched] = useLocalStorageState([], "watched");

  function handleSelectMovie(id) {
    setSelectedId((current) => (current === id ? null : id)); // Toggle selection
  }

  function handleCloseMovie() {
    setSelectedId(null); // Close movie details view
  }

  function handleAddWatched(movie) {
    setWatched((currentWatched) => [...currentWatched, movie]); // Add movie to watched list
  }

  function handleDeleteWatched(id) {
    setWatched((currentWatched) =>
      currentWatched.filter((movie) => movie.imdbID !== id) // Remove movie from watched list
    );
  }

  function handleEditWatched(id, updatedData) {
    setWatched((currentWatched) =>
      currentWatched.map((movie) =>
        movie.imdbID === id ? { ...movie, ...updatedData } : movie
      )
    );
  }

  return (
    <>
      <NavBar>
        <Logo />
        <Search query={query} setQuery={setQuery} />
        <NumResults movies={movies} />
      </NavBar>

      <Main>
        <Box>
          {isLoading && <Loader />}
          {!isLoading && !error && (
            <MovieList movies={movies} onSelectMovie={handleSelectMovie} />
          )}
          {error && <ErrorMessage message={error} />}
        </Box>

        <Box>
          {selectedId ? (
            <MovieDetails
              selectedId={selectedId}
              onCloseMovie={handleCloseMovie}
              onAddWatched={handleAddWatched}
              watched={watched}
            />
          ) : (
            <>
              <WatchedSummary watched={watched} />
              <WatchedMoviesList
                watched={watched}
                onDeleteWatched={handleDeleteWatched}
                onEditWatched={handleEditWatched}
              />
            </>
          )}
        </Box>
      </Main>
    </>
  );
}

function Loader() {
  return <div className="loader">Loading...</div>; // Loading indicator
}

function ErrorMessage({ message }) {
  return <div className="error">{message}</div>; // Display error message
}

function NavBar({ children }) {
  return (
    <nav className="nav-bar">
      {children}
    </nav>
  );
}

function Logo() {
  return (
    <div className="logo">
      <span role="img" aria-label="popcorn">
        üçø
      </span>
      <h1>usePopcorn</h1>
    </div>
  );
}

function NumResults({ movies }) {
  return (
    <p className="num-results">
      Found <strong>{movies?.length || 0}</strong> results
    </p>
  );
}

function Box({ children }) {
  const [isOpen, setIsOpen] = useState(true);

  return (
    <div className="box">
      <button className="btn-toggle" onClick={() => setIsOpen((open) => !open)}>
        {isOpen ? "‚Äì" : "+"}
      </button>
      {isOpen && children}
    </div>
  );
}

function Movie({ movie, onSelectMovie }) {
  return (
    <li className="movie-item" onClick={() => onSelectMovie(movie.imdbID)}>
      <img src={movie.Poster} alt={`${movie.Title} poster`} />
      <h3>{movie.Title}</h3>
      <p>
        {movie.Year} ‚Ä¢ {movie.Type}
      </p>
    </li>
  );
}

function Search({ query, setQuery }) {
  const inputEl = useRef(null);

  useKey("Enter", function () {
    if (document.activeElement === inputEl.current) return;
    inputEl.current.focus();
    setQuery("");
  });

  return (
    <input
      className="search"
      type="text"
      placeholder="Search movies..."
      value={query}
      onChange={(e) => setQuery(e.target.value)}
      ref={inputEl}
    />
  );
}

function Main({ children }) {
  return <main className="main">{children}</main>;
}

function MovieList({ movies, onSelectMovie }) {
  return (
    <ul className="list list-movies">
      {movies?.map((movie) => (
        <Movie movie={movie} key={movie.imdbID} onSelectMovie={onSelectMovie} />
      ))}
    </ul>
  );
}

function WatchedSummary({ watched }) {
  const avgImdbRating =
    watched.reduce((acc, movie) => acc + movie.imdbRating, 0) /
    watched.length || 0;
  const avgUserRating =
    watched.reduce((acc, movie) => acc + movie.userRating, 0) /
    watched.length || 0;
  const avgRuntime =
    watched.reduce((acc, movie) => acc + movie.runtime, 0) /
    watched.length || 0;

  return (
    <div className="summary">
      <h2>Watched Movies</h2>
      <p>Total Movies: {watched.length}</p>
      <p>Average IMDb Rating: {avgImdbRating.toFixed(2)}</p>
      <p>Average User Rating: {avgUserRating.toFixed(2)}</p>
      <p>Average Runtime: {avgRuntime.toFixed(2)} mins</p>
    </div>
  );
}

function WatchedMoviesList({ watched, onDeleteWatched, onEditWatched }) {
  return (
    <ul className="list watched-movies">
      {watched.map((movie) => (
        <WatchedMovie
          key={movie.imdbID}
          movie={movie}
          onDeleteWatched={onDeleteWatched}
          onEditWatched={onEditWatched}
        />
      ))}
    </ul>
  );
}

function WatchedMovie({ movie, onDeleteWatched, onEditWatched }) {
  function handleEdit() {
    const updatedRating = prompt("Enter new rating:", movie.userRating || 0);
    const updatedData = { userRating: Number(updatedRating) || 0 };
    onEditWatched(movie.imdbID, updatedData);
  }

  return (
    <li>
      <img src={movie.Poster} alt={`${movie.Title} poster`} />
      <h3>{movie.Title}</h3>
      <p>IMDb Rating: {movie.imdbRating}</p>
      <p>User Rating: {movie.userRating}</p>
      <p>Runtime: {movie.runtime} mins</p>
      <button onClick={() => onDeleteWatched(movie.imdbID)}>Delete</button>
      <button onClick={handleEdit}>Edit</button>
    </li>
  );
}
